import { defineStore } from "pinia"
import getters from './getters'
import { actions } from './actions'
const state = {
  playlists: [
    {
      id: 1,
      name: 'first playlist',
      playlist: [
        {
          videoId: '16y1AkoZkmQ',
          name: 'Rasputin',
          index: 0
        },
        {
          videoId: 'Qaar0K5ThcM',
          name: `Let's stay the same`,
          index: 1
        }, {
          videoId: 'pnjRMmrGEjU',
          name: 'Younger you',
          index: 2,
        },
        {
          videoId: 'lxF31-mHLz0',
          name: 'Questions',
          index: 3
        }]
    }
  ],
  currentPlaylist: [],
  currentSong: {
    videoId: '',
    name: ''
  },
  selectedPlaylistId: -1
}

export const usePlaylistStore = defineStore('playlist', {
  state: () => state,
  getters,
  actions
})
